[SysClientCacheDataMethod(true)]
public display Notes notes(HMClaimTable _hmClaimTable)
{
    HMClaimNotes    claimNotes;

    select firstonly Notes from claimNotes
        order by claimNotes.RecId desc
            where claimNotes.HMClaimTable == _hmClaimTable.RecId;

    return claimNotes.Notes;
}

[SysClientCacheDataMethod(true)]
public display ModifiedBy modifiedBy(HMClaimTable _hmClaimTable)
{
    HMClaimNotes    claimNotes;

    select firstonly ModifiedBy from claimNotes
        order by claimNotes.RecId desc
            where claimNotes.HMClaimTable == _hmClaimTable.RecId;

    return claimNotes.ModifiedBy;
}

[SysClientCacheDataMethod(true)]
public display ModifiedDateTime createdDateTime(HMClaimTable _hmClaimTable)
{
    HMClaimNotes    claimNotes;

    select firstonly ModifiedDateTime from claimNotes
        order by claimNotes.RecId desc
            where claimNotes.HMClaimTable == _hmClaimTable.RecId;

    return claimNotes.ModifiedDateTime;
}
